public class P1_main {

	public static void main(String[] args) {
		int x=0;
		while (x <= 10 ) {
			x = x+1;
			System.out.println(x);
		}
		x = 0;
		// TODO Auto-generated method stub
		for (int i = x+1; i <= 11; i++) {
			System.out.println(i);

	}
		x = 0;
		do {
			x = x+1;
			System.out.println(x);
		}
		while(x <=10);
	
	}

}
